//upload.wikimedia.org/wikipedia/commons/archive/4/4f/20220301065554%212022_Russian_invasion_of_Ukraine.svg",comment:"Small update: Russian troops are in Chernihivka (near Tokmak)"},{date:"2022-03-01T00:45:00.000Z",url:"https://upload.wikimedia.org/wikipedia/commons/archive/4/4f/20220301004953%212022_Russian_invasion_of_Ukraine.svg",comment:"Russian troops spotted around the Zaporizhzhia nuclear facility in Enerhodar they have not been spotted at Zaporizhzhia itself. Also, northern front; there is no mention of exact complete control of the border, so reverted (only the town Seredyna-Buda has been taken)."},{date:"2022-02-28T18:52:00.000Z",url:"https://upload.wikimedia.org/wikipedia/commons/archive/4/4f/20220228185704%212022_Russian_invasion_of_Ukraine.svg",comment:"Berdyansk and Donetsk fronts connected sieging Mariupol from land, according to US state department Russian troops are occupying major roads and bypassing off road terrains and major town, do not color landmasses surrounding captured settlements unless stated by references, thanks"},{date:"2022-02-28T18:29:00.000Z",url:"https://upload.wikimedia.org/wikipedia/commons/archive/4/4f/20220228185218%212022_Russian_invasion_of_Ukraine.svg",comment:"Small fixes, update to Kiev frontline (Makariv, Borodyanka, Bucha & Vorzel' are being attacked)"},{date:"2022-02-28T16:28:00.000Z",url:"https://upload.wikimedia.org/wikipedia/commons/archive/4/4f/20220228182922%212022_Russian_invasion_of_Ukraine.svg",comment:"Added: Bombing of Kyinka and fixed location of other bombing on Chernihiv. Updated extent of road control towards Nizhyn and Pryluky. Updated frontline Schastia and Trokhizbenka. Fixed frontline around Prymorsk. Added bombing Zhytomyr."},{date:"2022-02-28T12:26:00.000Z",url:"https://upload.wikimedia.org/wikipedia/commons/archive/4/4f/20220228162824%212022_Russian_invasion_of_Ukraine.svg",comment:"Kup'yans'k has been taken over by Russian forces: https://www.pravda.com.ua/eng/news/2022/02/27/7326623/ . Thanks Abs